# Function to get the current index for the key
def get_current_key_index():
    now = datetime.datetime.now()
    # Total hours since midnight
    total_hours = now.hour + now.minute / 60
    # Every 2 hours, switch to the next key
    index = int(total_hours // 2) % 12
    return index


# Function to get the current environment variables
def get_current_env_vars():
    url = f'https://api.render.com/v1/services/{service_id}/env-vars'
    headers = {'Authorization': f'Bearer {api_token}'}
    response = requests.get(url, headers=headers)
    if response.status_code == 200:
        env_vars_data = response.json()
        env_vars = [var['envVar'] for var in env_vars_data]
        return env_vars
    else:
        print("Failed to retrieve environment variables")
        return None

# Function to update the BINGAI_TOKEN environment variable
def update_bingai_token(new_value):
    env_vars = get_current_env_vars()
    if env_vars is not None:
        updated = False
        for var in env_vars:
            if var['key'] == 'BINGAI_TOKEN':
                var['value'] = new_value
                updated = True
                break
        if not updated:
            env_vars.append({'key': 'BINGAI_TOKEN', 'value': new_value})


        # Make the API request to update the environment variables
        url = f'https://api.render.com/v1/services/{service_id}/env-vars'
        headers = {'Authorization': f'Bearer {api_token}', 'Content-Type': 'application/json'}
        response = requests.put(url, json=env_vars, headers=headers)

        if response.status_code == 200:
            print("Environment variable updated successfully")
        else:
            print(f"Failed to update environment variable: {response.text}")


# Function to redeploy the service
def redeploy_service():
    url = f'https://api.render.com/v1/services/{service_id}/deploys'
    headers = {'Authorization': f'Bearer {api_token}'}
    response = requests.post(url, headers=headers)

    if response.status_code in [200, 202]:
        print('Service redeployment triggered successfully')
    else:
        print(f'Failed to trigger service redeployment: {response.text}')


